import { response } from "express" ;

 function scraper (api) {
     fetch (`https://api.github.com/repos/BrightNate1022/git_scrap ${api} `)

    if (scraper.api === null) {
        fetch ("https://api.github.com/repos/BrightNate1022/git_scrap")
       
      } else {
        fetch (`https://api.github.com/repos/BrightNate1022/git_scrap${scraper.api}`)
        
      }
    
    (response => response.json())
    // .then (console.log (response))
    (data => console.log (data));   
 }     


export default scraper 
